import React, { useEffect, useRef } from "react";

import styled from 'styled-components';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import '../home/slider.css';
function CarouselSlider() {
    const sliderRef = useRef(null);
  
    useEffect(() => {
      $(sliderRef.current).slick({
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              infinite: true,
              dots: true,
            },
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
            },
          },
        ],
      });
    }, []);
  
    return (
      <div ref={sliderRef}>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 1</h3>
          <p>Description 1</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 2</h3>
          <p>Description 2</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 3</h3>
          <p>Description 3</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 4</h3>
          <p>Description 4</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 5</h3>
          <p>Description 5</p>
        </div>
        <div>
          <img src="https://via.placeholder.com/300x200" alt="food" />
          <h3>Food Item 6</h3>
          <p>Description 6</p>
        </div>
      </div>
    );
  }

  export default CarouselSlider;
